import React, { Component } from 'react';
import Axios from 'axios';

export default class App extends Component {
    constructor(){
        super();
        this.state = {
            indexData: []
        }
    }

    componentDidMount(){
        this.selectDefault();
        console.log(this.state.indexData);
    }


    selectDefault = async () => {
        try {
            const value = await Axios.get('http://localhost:8080/');
            const data = value.json();
            console.log(data);

        } catch (err) {
            console.log(err);
        }
    }
    render() {
        return (
            <div>Hello There !</div>
        );
    }
}
